import React from 'react';
import ReactDOM from 'react-dom';

const Weather = ({ weather,loading}) => {

    if(loading)
        return<h2>Loading...</h2>
    return(
        <ul>
            {weather.map(weathers => (
                <li>
                    {weathers.humidity}
                </li>
            ))}
        </ul>
    );
};

export default Weather;
